import React from 'react';
import "./style.scss";
import profilePhoto from "../images/logo/man.jpg";
import { SocialLogos, Buttons, ColoredCards } from "../misc";
import Particles from 'react-particles-js';

const Home = () => {

    return (
        <div className="home-container">
                 <Particles
        id="tsparticles"
        options={{
          background: {
            color: {
              value: "#0d47a1",
            },
          },
          fpsLimit: 60,
          interactivity: {
            detectsOn: "canvas",
            events: {
              onClick: {
                enable: true,
                mode: "push",
              },
              onHover: {
                enable: true,
                mode: "repulse",
              },
              resize: true,
            },
            modes: {
              bubble: {
                distance: 400,
                duration: 2,
                opacity: 0.8,
                size: 40,
              },
              push: {
                quantity: 4,
              },
              repulse: {
                distance: 200,
                duration: 0.4,
              },
            },
          },
          particles: {
            color: {
              value: "#ffffff",
            },
            links: {
              color: "#ffffff",
              distance: 150,
              enable: true,
              opacity: 0.5,
              width: 1,
            },
            collisions: {
              enable: true,
            },
            move: {
              direction: "none",
              enable: true,
              outMode: "bounce",
              random: false,
              speed: 6,
              straight: false,
            },
            number: {
              density: {
                enable: true,
                value_area: 800,
              },
              value: 80,
            },
            opacity: {
              value: 0.5,
            },
            shape: {
              type: "circle",
            },
            size: {
              random: true,
              value: 5,
            },
          },
          detectRetina: true,
        }}
             />
            <div className="home-colorSepator" id="tsparticles"></div>
            <div className="home">
                <div className="home-profilePhoto_container">
                    <div className="image">
                        <a href="jerryprophete.com" alt="jerryprophete">
                        <img src={profilePhoto} alt="jerry" title="Jerry Prophete" />
                        </a>
                    </div>
                </div>

                <div className="home-socialMedia">
                    <SocialLogos isTrue={true} />
                </div>

                <div className="home-para">
                    <p>
                        <span className="p1">Hey There!</span>
                        <span className="p2">I am Jerry Prophete.</span>
                        <span className="p3">I can build your website.</span>
                    </p>

                </div>
                <div className="theButton">
                    <Buttons
                        backColor=  "var(--sixth_color)"
                        text="Hire ME"
                        color="var(--first_color)"
                        link="b.com"
                    />
                </div>

                <div className="colored_section">
                    <ColoredCards color="var(--first_color)" />
                    <ColoredCards color="var(--seventh_color)" />
                    <ColoredCards color="var(--fifth_color)" />
                </div>
            </div>
        </div>
    );
};

export default Home;
